import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ListPlanComponent from './components/AdminComponents/ListPlanComponent';
import HeaderComponent from './components/AdminComponents/HeaderComponent';
import FooterComponent from './components/AdminComponents/FooterComponent';
import CreateEmployeeComponent from '../../employeems-frontend/src/Components/CreateEmployeeComponent';
function App() {
  return (
    <div className="App">
      <Router>
        <div className='container'>

          <HeaderComponent />
          <div className="container">
            <Routes >
            <Route path="/" element={<ListPlanComponent />} />
            <Route path="/employees" element={<ListPlanComponent />} />
            <Route path="/add-plan/:id" element={<CreateNewPlanComponent />} />
            <Route path="/view-plan/:id" element={<ViewPlanComponent />} />

            </Routes>
          </div>
          <FooterComponent />
        </div>
      </Router>
    </div>
  );
}

export default App;
